import React from 'react';

const CarouselSlide = () => {
  return (
    <div
      className="carousel-3d-slide"
      style={{
        borderWidth: '1px',
        width: '362px',
        height: '272px',
        transition: 'transform 500ms, opacity 500ms, visibility 500ms',
        transform: 'translateX(-200px) translateZ(-400px) rotateY(0deg)',
        zIndex: '998',
        opacity: '1',
        visibility: 'visible',
        position: 'relative',
      }}
    >
      {/* Blog Banner */}
      <div
        className="blogbanner"
        style={{
        //   backgroundImage: `url("https://www.rvps.edu.in/wp-content/uploads/2024/11/Cover-page-october.jpg")`,
          height: '150px',
          backgroundPosition: 'center center',
          backgroundSize: 'cover',
          borderRadius: '5px 5px 0 0',
          position: 'relative',
        }}
      >
        {/* Blog Date */}
        <div
          className="blogdate"
          style={{
            position: 'absolute',
            bottom: '10px',
            left: '10px',
            padding: '5px 10px',
            backgroundColor: 'rgba(0, 0, 0, 0.5)',
            color: '#fff',
            borderRadius: '5px',
            fontSize: '12px',
          }}
        >
          Nov 6, 2024
        </div>
      </div>

      {/* Slider Description */}
      <div
        className="slider-desc"
        style={{
          padding: '10px',
          backgroundColor: '#fff',
          borderRadius: '0 0 5px 5px',
          height: '120px',
          boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
        }}
      >
        <div
          className="blog-title"
          style={{
            fontWeight: 'bold',
            fontSize: '16px',
            marginBottom: '5px',
            color: '#333',
          }}
        >
          October 2024
        </div>
        <div
          className="blog-description"
          style={{
            fontSize: '14px',
            color: '#555',
            lineHeight: '1.4',
            overflow: 'hidden',
            textOverflow: 'ellipsis',
            whiteSpace: 'nowrap',
          }}
        >
          Dasara Celebration: Students of the Pre-primary wing of the school brought dolls and arranged them in a golu...
        </div>

        {/* More Button */}
        <div
          className="more-btn"
          style={{
            marginTop: '10px',
            textAlign: 'right',
          }}
        >
          <a
            href="https://www.rvps.edu.in/october-2024/"
            style={{
              textDecoration: 'none',
              color: '#007bff',
              fontSize: '14px',
              fontWeight: 'bold',
            }}
          >
            Know More
          </a>
        </div>
      </div>
    </div>
  );
};

export default CarouselSlide;
